var main=function(){$("#shorten .submit").click(function(){var b=$("#url-to-shorten").val();console.log("shorten..."+b);$.ajax({cache:!1,type:"GET",url:"url_shorten.action",data:{url:b},dataType:"json",error:function(a){console.log("fail"+a)},success:function(a){$("#generate-url").html("Your Short URL:  <a href='"+a.url+"'>"+a.url+"</a>")}})})};